import styled from "styled-components";

const ModalStyled = styled.div`
  display: flex;
  position: fixed;
  top: 8%;
  left: 50%;
  transform: translate(-50%);
  width: 85em;
  height: 50em;
  z-index: 4;
  background: white;
  padding: 1em;
  border-radius: 5px;
`;

export default ModalStyled;
